import pinyin from 'tiny-pinyin';
import { capitalize } from 'lodash';
import Vue from 'vue';
import Component from 'vue-class-component';
@Component
export default class PersonalForm extends Vue {
  private citys: string[] = [];
  private mounted() {
    this.$http.get('/cn.city.json').then(result => (this.citys = result.data));
  }
  toPinyin(str: string) {
    return pinyin
      .parse(str)
      .map(s => capitalize(s.target))
      .join('');
  }
  get lang() {
    return this.$store.state.language;
  }
}
